assertion_content('medEventKitExplication','iMEDEventKitE039',s("Tailgating",",","or","a","tailgate","party",",","is","a","social","event","that","occurs","around","the","open","tailgate","or","trunk","of","a","vehicle",".","Activities","at","a","tailgate","party","include","eating","grilled","food","and","snacks",",","drinking","beverages","(","especially","alcoholic","beverages",")",",","listening","to","music",",","and","playing","games","(","especially","lawn","games","such","as","cornhole",",","horseshoes",",","etc.",")","Tailgating","typically","occurs","in","the","parking","lot","of","a","sporting","event","or","music","concert",",","and","usually","occurs","prior","to","and","during","the","event","itself",".","Typical","beverages","consumed","include","beer","and","mixed","alcoholic","drinks",".","Popular","food","consists","of","standard","picnic","staples",",","including","grilled","meat","such","as","hamburgers","and","hotdogs",",","cold","salads","(","potato","salad",",","macaroni","salad",",","and","coleslaw",")","and","snacks","such","as","potato","chips","and","pretzels",".","Tailgating","is","especially","popular","prior","to","professional","football","games",",","but","also","occurs","prior","to","other","sporting","events","and","music","concerts","."),5595758).
assertion_content('medEventKitExplication','iMEDEventKitE040',s("Tuning","is","the","process","of","adjusting","the","pitch","of","tones","from","musical","instruments","to","establish","typical","intervals","between","these","tones","based","on","a","fixed","reference","pitch",".","There","are","a","number","of","methods","for","tuning","an","instrument",",","including","tuning","to","a","pitch","with","one","'","s","voice","(","or","\"","tuning","by","ear","\"",")",",","turning","pegs","to","increase","or","decrease","the","tension","on","strings","so","as","to","control","the","pitch",",","or","modifying","the","length","or","width","of","the","tube","of","a","wind","instrument",",","brass","instrument",",","pipe",",","bell",",","or","similar","instrument","to","adjust","the","pitch",".","Tuning","may","be","also","be","done","aurally","by","sounding","two","pitches","and","adjusting","one","of","them","to","match","the","other",",","such","as","with","a","tuning","fork","or","electronic","tuning","device","that","produces","the","reference","pitch","(","es",")","-","matching","in","this","context","may","mean","bringing","two","sounds","to","the","same","pitch","or","may","involve","tuning","the","two","pitches","to","a","desired","interval","and","then","fine-tuning","the","interval","to","adjust","the","beat","frequency","to","a","desired","frequency",".","Using","an","electronic","tuning","device","may",",","rather","than","comparing","pitches","by","ear",",","involve","adjusting","the","pitch","from","the","musical","instrument","until","the","electronic","device","indicates","the","measured","pitch","is","as","desired",".","In","the","case","of","an","orchestra","or","wind","band",",","the","reference","pitch","is","usually","played","by","an","oboe",",","which","everyone","else","then","tunes","to","by","comparing","their","instrument","'","s","pitch","to","the","pitch","of","the","oboe",".","Tuning","a","piano","involves","using","a","specialized","wrench","(","often","called","a","tuning","hammer",")","to","adjust","the","tension","of","one","string","at","a","time","(","altering","its","pitch",")","and","the","use","of","rubber","or","felt","mutes","to","control","which","string","is","producing","sound","(","so","that","a","single","string","at","a","time","can","be","tuned",")","Piano","tuners","may","use","an","electronic","device","or","a","program","running","on","a","laptop","computer","or","smart","phone",",","but","may","instead","tune","the","piano","entirely","\"","by","ear","\"","(","aural","tuning",")","sometimes","using","only","a","tuning","fork","as","an","initial","pitch","reference",".","It","is","not","unusual","to","tune","part","of","a","piano","using","a","device","and","the","rest","by","ear",".","Tuning","a","pipe","organ","will","involve","one","person","to","play","the","notes","from","the","organ","keyboard/pedalboard","(","the","console",")","and","another","to","tune","the","pipes",".","Tuning","tympani","(","kettle","drums",")","will","usually","involve","a","pedal","on","each","drum",",","with","the","pedal","adjusting","the","pitch","."),5595767).
